  [],\n\t\"revision_timestamp\": \"2015-09-27T02:08:24.904458\",\n\t\"name\": \"project-birdseye-aerial-photograph-collection-digital-and-analog-materials\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"nThis collection consists of both analog
  and digital aerial photographs from Arctic areas in and around Baffin Bay, the Labrador
  Sea, the Arctic Ocean, the Beaufort and Chukchi Seas, and the Bering Sea and Strait
  from 1962 to 1984 as well as data reports from 1962 through 1971.The US Navyu00e2u0080u0099s
  Project Birdseye spanned approximately 1962 to the mid-1980s. Over more than 20
  years, the project generated numerous reports as well as visible band photographs
  and other data. The aerial photographs reside in 99 film canisters, each approximately
  a foot tall and six inches in diameter containing roughly 400 photographic negatives
  in a long film roll. Photographs from seven of the canisters have been digitized,
  resulting in 1752 image files. These are available via FTP along with project reports
  and documents on the history of Project Birdseye. In addition to the film canisters,
  two boxes of flight data logs and maps are currently held by NSIDC.n\",\n\t\"license_title\":
